Exclusividade do Serviço: O CRQ-BA é a única entidade autorizada por lei a realizar o registro e a fiscalização de pessoas físicas e jurídicas que atuem no campo da química no estado da Bahia. Isso caracteriza uma situação de inexigibilidade de licitação, conforme o art. 74 da Lei nº 14.133/2021, que dispensa licitação em casos de inviabilidade de competição.
Necessidade de Regularização Institucional: O SAAE Taperoá/BA realiza atividades essenciais para a população, como a captação, o tratamento e a distribuição de água. Essas atividades exigem a participação de profissionais habilitados na área química, com registros ativos e a emissão das Anotações de Responsabilidade Técnica (ARTs) para os serviços realizados. O pagamento da anuidade garante a regularidade do registro institucional do SAAE junto ao CRQ-BA, enquanto as ARTs asseguram a formalização da responsabilidade técnica dos profissionais envolvidos nas operações. A ausência dessa regularização pode acarretar:
    • Multas e sanções administrativas;
    • Impedimento de operação devido à não conformidade com as normas regulatórias;
    • Comprometimento do serviço essencial de abastecimento de água à população.
Importância da ART: A Anotação de Responsabilidade Técnica (ART) é um documento indispensável, pois:
    • Define os profissionais responsáveis pelas atividades técnicas realizadas;
    • Garante a rastreabilidade e a conformidade das operações;
    • Proporciona segurança jurídica e técnica para a execução dos serviços.
A contratação do CRQ-BA para o pagamento da anuidade e das ARTs referentes ao exercício de 2025 é essencial para assegurar a regularidade legal e técnica do SAAE Taperoá/BA. A exclusividade do CRQ-BA na prestação desses serviços torna inexigível a licitação, garantindo o cumprimento das normas e a continuidade dos serviços essenciais prestados à população.
